class DataModel {
  final String contentId;
  final String imageTitle;
  final String videoTitle;
  final String imageDes;
  final String tagOne;
  final String tagTwo;
  final String price;
  final String imageEncoding;
  final String videoEncoding;

  const DataModel({
    required this.contentId,
    required this.imageTitle,
    required this.videoTitle,
    required this.imageDes,
    required this.tagOne,
    required this.tagTwo,
    required this.price,
    required this.imageEncoding,
    required this.videoEncoding,
  });

  factory DataModel.fromJson(Map<String, dynamic> json) {
    return DataModel(
      contentId: json['content_id'],
      imageTitle: json['image_title'],
      videoTitle: json['video_title'],
      imageDes: json['image_des'],
      tagOne: json['tag_one'],
      tagTwo: json['tag_two'],
      price: json['price'],
      imageEncoding: json['image_encoding'],
      videoEncoding: json['video_encoding'],
    );
  }

  Map<String, dynamic> toJson() {
    final Map<String, dynamic> data = <String, dynamic>{};
    data['content_id'] = contentId;
    data['image_title'] = imageTitle;
    data['video_title'] = videoTitle;
    data['image_des'] = imageDes;
    data['tag_one'] = tagOne;
    data['tag_two'] = tagTwo;
    data['price'] = price;
    data['image_encoding'] = imageEncoding;
    data['video_encoding'] = videoEncoding;

    return data;
  }
}

